import React from 'react';
import '../../css/header.css';
import classes from './header.module.css';
import {NavLink} from "react-router-dom";
const Header = (props) => {

    let frientElement = props.link.friends.friend.map(friend=>(<div> <div className={classes.iconsProfile}>1</div><p>{friend.name}</p></div>));
    let navigationElement = props.link.navigations.navigation.map(nav=>(<li><NavLink to={nav.id} activeClassName={classes.active}>{nav.name}</NavLink> </li>));
    return (
        <header className={classes.header}>
            <div className={classes.contentHeader}>
                <div className={classes.logo}>
                    <img className={classes.icons} src='https://3.bp.blogspot.com/-gSCjFoMwSrM/Wmhhcg2_WsI/AAAAAAAAN0s/YF9kM5Jnt30hautbcSOIg70qUQhEGyqWgCLcBGAs/s1600/dallas_mavericks.png' ></img>
                </div>
                <div className={classes.friends}>
                    <div className={classes.friend}>
                        {frientElement}
                    </div>
                </div>
                <div className={classes.menu}>
                    <ul>
                        {navigationElement}
                    </ul>
                </div>
            </div>
        </header>
    );
}
export default Header;
